import React, { Component } from 'react';
import './Day.css';

class Day extends Component {

        render() {
            var {
                date,
                symbol,
                temperature,
            } = this.props.data;
            return (
                <button className={"Weather-day " + date} onClick={console.log('5')}>
                    <p className="Weather-date"></p>
                    <p className="Weather-symbol"><img src={symbol} alt="symbol"/></p>
                    <p className="Weather-temperature">{temperature}</p>
                </button>
            );
        }
    }

export default Day;
